const httpService = {
    login: (data) => {
        return fetch("http://localhost:3030/user/login",
        {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(data)
        })
    }, 
    createUser: (data) => {
    
        return fetch("http://localhost:3030/user/create",
        {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(data)
        })
    },

    getToken: () => {
        return localStorage.getItem("token");
    },

    getUser: () => {
        return fetch("http://localhost:3030/user/create",
        {
            method: "GET",
            headers: {
                "Content-Type": "application/json"
            },
        })
    }
}
export default httpService
